import GridBox from "./Container";
import NavScrollExample from "./Header";
import Box2 from "./Box2";
import AutoLayoutSizingExample from "./Box3"
import { Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
<NavScrollExample/>
 <GridBox/>
<Box2/>
<AutoLayoutSizingExample/>
<Routes>
  <Route path='/' element={<NavScrollExample/> }/>
</Routes>
    </div>

  );
}

export default App;
